import React from 'react';
import { Box, Grid } from '@material-ui/core';
import './Css/Pricing.scss'

const Pricing = () => {
    return (
        <>
            <Box my={5} className="pricingWrapper">
                <Grid container>
                    <Grid></Grid>
                </Grid>
            </Box>
        </>
    )
}

export default Pricing
